import { useNavigate } from "react-router-dom";
import "./Form.css";
const Form = () => {
  // const navigate = useNavigate();
  const handleSearch = () => {
    // navigate("/search");
    window.location.replace("../earch/Search.jsx");
  };

  return (
    <form className="search-form">
      <label style={{ marginRight: "30px" }}>
        <i
          className="fa fa-bed"
          style={{ color: "#d6d6d6", marginRight: "5px" }}
        />
        Where are you going?
      </label>
      <label>
        <i
          className="fa fa-calendar"
          style={{ color: "#d6d6d6", marginRight: "5px" }}
        />
      </label>
      <input type="text" placeholder="06/24/2022 to 06/24/2022" />
      <label>
        <i
          className="fa fa-female"
          style={{ color: "#d6d6d6", marginRight: "5px" }}
        />
      </label>
      <input type="text" placeholder="1 adult 0 children 1 room" />
      <button className="button search-button" onClick={handleSearch}>
        Search
      </button>
    </form>
  );
};

export default Form;
